<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width,initial-scale=1.0" />
    <link rel="icon" href="<%= BASE_URL %>favicon.ico" />
    <title><%= htmlWebpackPlugin.options.title %></title>
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css?family=Roboto:100,300,400,500,700,900"
    />
    <link
      rel="stylesheet"
      href="https://cdn.jsdelivr.net/npm/@mdi/font@latest/css/materialdesignicons.min.css"
    />
    <style>
      html {
        overflow: hidden;
      }
      #loading {
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100vh;
        z-index: 1000;
        background-color: #fff;
      }

      #loading.mounted {
        animation: mount 0.18s forwards;
      }

      @keyframes mount {
        0% {
          opacity: 1;
        }
        99% {
          opacity: 0.1;
        }
        100% {
          opacity: 0;
          display: none;
          z-index: -1;
        }
      }

      .msg {
        color: #343434;
        font: 20px/20px Arial, sans-serif;
        letter-spacing: 0.2px;
        text-align: center;
      }

      #nlpt {
        animation: a-s 0.5s 2.5s 1 forwards;
        background-color: #f1f1f1;
        height: 4px;
        margin: 20px auto 20px;
        opacity: 0;
        overflow: hidden;
        position: relative;
        width: 300px;
      }

      #nlpt::before {
        animation: a-lb 20s 3s linear forwards;
        background-color: #eda306;
        content: "";
        display: block;
        height: 100%;
        position: absolute;
        transform: translateX(-300px);
        width: 100%;
      }

      @keyframes a-lb {
        0% {
          transform: translateX(-300px);
        }
        5% {
          transform: translateX(-240px);
        }
        15% {
          transform: translateX(-30px);
        }
        25% {
          transform: translateX(-30px);
        }
        30% {
          transform: translateX(-20px);
        }
        45% {
          transform: translateX(-20px);
        }
        50% {
          transform: translateX(-15px);
        }
        65% {
          transform: translateX(-15px);
        }
        70% {
          transform: translateX(-10px);
        }
        95% {
          transform: translateX(-10px);
        }
        100% {
          transform: translateX(-5px);
        }
      }

      @keyframes a-s {
        100% {
          opacity: 1;
        }
      }

      @keyframes a-h {
        100% {
          opacity: 0;
        }
      }

      @keyframes a-nt {
        100% {
          transform: none;
        }
      }

      @keyframes a-e {
        43% {
          animation-timing-function: cubic-bezier(0.8, 0, 0.2, 1);
          transform: scale(0.75);
        }
        60% {
          animation-timing-function: cubic-bezier(0.8, 0, 1, 1);
          transform: translateY(-16px);
        }
        77% {
          animation-timing-function: cubic-bezier(0.16, 0, 0.2, 1);
          transform: none;
        }
        89% {
          animation-timing-function: cubic-bezier(0.8, 0, 1, 1);
          transform: translateY(-5px);
        }
        100% {
          transform: none;
        }
      }

      @keyframes a-es {
        24% {
          animation-timing-function: cubic-bezier(0.8, 0, 0.6, 1);
          transform: rotate(-25deg);
        }
        52% {
          animation-timing-function: cubic-bezier(0.63, 0, 0.2, 1);
          transform: rotate(-42.5deg);
        }
        83% {
          animation-timing-function: cubic-bezier(0.8, 0, 0.84, 1);
          transform: rotate(-42deg);
        }
        100% {
          transform: rotate(-43deg);
        }
      }

      .invfr {
        position: absolute;
        left: 0;
        top: 0;
        z-index: -1;
        width: 0;
        height: 0;
        border: 0;
      }

      .msgb {
        position: absolute;
        right: 0;
        font-size: 12px;
        font-weight: normal;
        color: #000;
        padding: 20px;
      }
    </style>
  </head>
  <body>
    <noscript>
      <strong
        >We're sorry but <%= htmlWebpackPlugin.options.title %> doesn't work
        properly without JavaScript enabled. Please enable it to
        continue.</strong
      >
